    return (
        <div>
            <div class="sidebar-usuario">
                <img src="Imagens/catanacomics.png"/>
                <div class="infoU">
                    <p class="negrito">catanacomics</p>
                    <span class="nomeU">Catana <ion-icon name="pencil" ></ion-icon></span>
                </div>
            </div>
        </div>
    )
}
